import React from 'react';
import {PTitle, Body, Core, Header, Flavor, Portal, TitleBar,
        Tools, Text, Img} from './style';
import {Buttons, HotButton} from '../Components/Body';

export class KingsGambit extends React.Component {  
  componentDidMount() {
    window.scrollTo(0, 0)
  };
  render() {
    return (
      <React.Fragment>
        <span id="top"/>
        <TitleBar>
          <PTitle>A King's Gambit</PTitle>
          <Flavor>Physics puzzles with horror...</Flavor>
        </TitleBar>
        <Core>
          <Body>
            <Header>
              What I Learned
            </Header>
            <Tools>AI Behaiviors - Playtesting</Tools>
            <Text>

            </Text>
            <Portal height="400" src="https://www.youtube.com/embed/DTujndYq82E" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allow="fullscreen"></Portal>

            <Header>
              About
            </Header>
            <Tools>Unity - C#</Tools>
            <Text>

            </Text>
            
          </Body>
        </Core>
      </React.Fragment>
    );
  };
}

export default KingsGambit;
